const gallery = document.getElementById('gallery');
const figures = [];
images.forEach(({ src, title }) => {
    /*створив теги*/
  const figure = document.createElement('figure'); 
  const img = document.createElement('img'); 
  const caption = document.createElement('figcaption');
  /*звертаюсь до посилання*/
  img.src = src;
  img.alt = title;


  caption.textContent = title;

  /*додаю елементи до DOM*/ 
  figure.appendChild(img);
  figure.appendChild(caption);
  gallery.appendChild(figure);
  figures.push({ figure, title });


  /*фільтрація швиденька*/ 
});
const filterGallery = () => {
const filterText = document.getElementById('filter').value.toLowerCase();


figures.forEach(({ figure, title }) => {
if (title.toLowerCase().includes(filterText)) {
  figure.style.display = 'block';
} else { figure.style.display = 'none'; }
  });
};
document.getElementById('filter').addEventListener('input', filterGallery);



